import {Outlet, Link} from 'react-router-dom';
// instead of parental div can use this fragment has no use as such just to follow convention
import { Fragment } from "react";
// now we can import the crown.svg as react component
import { ReactComponent as CrwnLogo } from '../../../assets/cr';

import './navigation.styles.scss'

const Navigation = () =>{
    <Fragment>
        <div className='navigation'>
            {/* link is like anchor a only but works well with different browser's dom */}
            <Link className= 'logo-containert' to='/'>
                <CrwnLogo className="logo"/>
            </Link>
        </div>
        <div className='nav-links-container'>
            <Link className= 'nav-link' to='/shop'>
                SHOP
            </Link>
        </div>
        <Outlet />
    </Fragment>
}

export default Navigation;
